    false,nt"url": null,nt"notes": "This dataset consists of classified LiDAR
    (Light Detection and Ranging) elevation points produced by the PAMAP Program. PAMAP
    data are organized into blocks, which do not have gaps or overlaps, that represent
    10,000 feet by 10,000 feet on the ground. The coordinate system for blocks in the
    northern half of the state is Pennsylvania State Plane North (datum:NAD83, units:
    feet); blocks in the southern half of the state are in Pennsylvania State Plane
    South. A block name is formed by concatenating the first four digits of the State
    Plane northing and easting defining the block's northwest corner, the State identifier
    "PA", and the State Plane zone designator "N" or "S" (e.g. 45001210PAS). The
    following are the collection dates for each county chronologically from 2006-2008:
    CLARION : 20060321 - 20060502 FOREST : 20060321 - 20060502 MERCER : 20060321 - 20060502
    VENANGO : 20060321 - 20060502 LUZERNE : 20060406 - 20060429 CAMERON : 20060426 -
    20060430 CENTRE : 20060426 - 20060430 CLEARFIELD : 20060426 - 20060430 JEFFERSON
    : 20060426 - 20060430 ELK : 20060426 - 20060430 & 20060321 - 20060502 CLINTON :
    20070430 CRAWFORD : 20070430 ERIE : 20070430 LACKAWANNA : 20070430 LYCOMING : 20070430
    MCKEAN : 20070430 POTTER : 20070430 TIOGA : 20070430 UNION : 20070430 WARREN : 20070430
    MONTOUR : 20080325 - 20080506 COLUMBIA : 20080325 - 20080506 & 20080410 - 20080419
    NORTHUMBERLAND : 20080325 - 20080506 & 20080414 - 20080510 BRADFORD : 20080406 -
    20080505 SULLIVAN : 20080406 - 20080505 WYOMING : 20080406 - 20080505 PIKE : 20080409
    - 20080507 WAYNE : 20080409 - 20080507 SUSQUEHANNA : 20080409 - 20080507 & 20080406
